import React, { Component } from 'react';

class Entries extends Component {
    constructor(props){
        super(props)

        this.state = {
            entries: [],
            show: this.props.show,
        }

        this.mapStyleToProps = {
            display: this.state.show,
        }
    }


    render(){
        return (
            <div style={this.mapStyleToProps}>
                <h1> Entries </h1>
            </div>

        )
    }

}

export default Entries;
